{"description":"I’d like to vouch for Nat, the OG of Pudgy Penguins Thailand and a true community builder at heart. He’s been a welcoming force in the Thai Web3 scene — always the first to reach out, help newcomers, and make sure people feel at home. If you’re ever in Thailand, hitting him up is a must.

Nat is all about education and empowerment. He’s constantly helping others level up — whether it’s through sharing knowledge, supporting builders, or encouraging growth in the space. A real pillar in the local community.

No question — Nat is the GOAT of Pudgy and Abstract Thailand."}

{
  "description": "Pavil is an incredible street artist which made a huge graffiti artworks for communities like Abstract and Pudgy Penguins, and many others.

Always supportive and have a big heart, deserves a lot of recognition for his work.

It takes a lot of effort to make something like he does, and it brings a lot of positivity and unites the space.

Also, he's done an Ironman triathlon, which takes a lot of preparation and physical health, which is so inspirational."
}

{
  "description": "Ayo, we didn't talk to much in DMs or in person. Met each other in Abstract, we both artists, both gigachads, both been on few spaces/streams. His penguins train forever in my heart lol & im sure that we will see much more art works for community from Bunya. No doubts that we will meet each other on more spaces in future & bring more attention to artists in web3, especially in Pudgy & Abstract Eco. Happy to support with review"
}

{
  "description": "He is a person committed to the abstract, I see him everywhere on X spreading the green chain. He's one of the first giga chads, an OG. He totally deserves his role."
}

{
  "description": "I know Bubya as a true artist in the Abstract ecosystem, someone overflowing with passion for Abstract Chain and Abstractio.\n\nI’ve followed him on X for a long time, and every post he makes radiates pure creative energy, from 3D to 2D, from motion to animation, everything is top-tier."
}

{
  "description": "When people talk to me about Loko, I think of the Ozy NFT collection. Loko is an abstract OG, he works and helps differents projects with his designer talents. In addition to being talented, Loko is extremely kind. Very happy to be by his side as a giga."
}

{"description":"I know Badlynasty for a long time in Abstract journey 

He is a great giga chad and a big streamer on Abstract Portal, he is always share many useful insights about abstract and have a deeply explore in Abstract ecosystem 

if you are new for abstract , you should follow him, keep up the great work forever my friend"}

{
  "description": "First time we knew each other though the Huddle, a bit later when i joined Abstract and found out Brian. He is leading Asia region in ecosystem. So warm welcome newbies not only via socials like X, tg, discord, also IRL events (so important). Brian is real legend, happy to support him in such on-chain journey"
}

{
  "description": "WhitestWizard is undeniably a pure person. I met him on abstract and he is a great person. He has always been involved in abstract, he is part of a team that builds on abstract, he is also a very good streamer. Always there to animate and please his community. WhitestWizard is a sensitive person, if you understand him he will become your best friend. It took me a while to understand him, and I realize that we don't see many people like him anymore. I wish you all the best."
}

{
  "description": "Sinet is a great person I met on abstract. He's been committed and involved since the beginning. Always there to propagate the green chain. He makes quality and always useful threads on X. He's also a very good duper player. Sinet is a gigantic chad and it's completely deserved. I hope we go far together on abstract."
}

{
  "description": "I discovered Gucci on abstract and it was a great discovery. A happy person and always there to help you. He is an involved and committed person, when he loves something he does it fully. He became a content creator thanks to abstract and he is very talented. I wish you the best my brother and I hope that one day we can meet in real life. Love you Fratello."
}

{
  "description": "Dan is probably one of a few gigachads who are able to build technically various useful tools for creators and users on Abstract\n\nI knew him since we made it into gigachad on the same batch as I might didn't get to directly/personally talk to but he's someone who truly deserve a praise"
}

{"description":"Yo, just gotta say, my guy Pavil is the real deal. He’s not only an Abstract Gigachad but also a crazy talented graffiti artist. The way he brings Abstract to life with his murals is wild, and he’s been doing it across different projects too.

What I love most is when he streams the process. Sitting there watching him paint in real time has legit become one of the highlights of my week. Pure vibes, pure talent.

If you haven’t caught one of his streams or seen his work yet, you seriously should. Dude’s killing it."}
